import React, { Component } from 'react'
import ClientMain from "./components/ClientMain";
import './App.css';
import { Typography } from '@material-ui/core';

export default class App extends Component {

  render() {
    return (
      <div className="App">
        <ClientMain />
        <div>
          <Typography variant="body2">powered by <a href="https://tixpros.pro/" rel="noreferrer" target="_blank" >TixPros</a> - V{this.state.version}</Typography>
        </div>
      </div>
    )
  }
}
